import React from 'react';
import logo from './assets/tangerinerye_logo.png';
import './App.css';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <img src={logo} alt="Tangerine Rye band logo" />
      </div>
    );
  }
}

export default App;
